function jokuvammahehheentiia(x,y,width,height,color1,color2,max,position,horizontalorvertical,reverse)
	local x2 = x 
	local y2 = y
	local width2 = width
	local height2 = height
	if(horizontalorvertical)then
		width2 = (width2 / max)*position
		if(reverse)then
			x2 = (x2+(width / 2))-(width2/2)
		else
			x2 = (x2-(width / 2))+(width2/2)
		end
	else	
		height2 = (height2 / max)*position
		if(reverse)then
			y2 = (y2+(height / 2))-(height2/2)
		else
			y2 = (y2-(height / 2))+(height2/2)
		end
	end
	DrawRect(x,y,width,height,color1.r,color1.g,color1.b,color1.a)
